*
 * 全局数组接口的名称：libSQ
 *
 * command 相关信息见 `/src/constants/cmds`
 *
 * ready 事件名称，见 {@link EVT_READY}
 *
 * 初始化过程见 {@link bootstrapGlobalLib}
 *
 * @type {string}
 * @example
 * // 加载成功前后都可以
 * window.libSQ = window.libSQ || [];
 * window.libSQ.push(command);
 *
 * // 加载成功后
 * window.libSQ.exec(commandName, commandParams);
 *
 * // 使用 `ready` 事件
 * document.addEventListener('lib-sq-ready', (evt) => {
 *    const { lib } = evt.detail; // 或者使用 window.libSQ
 * }

